<h2>TWAP Risk Score Analysis</h2>
<p>The TWAP Risk Score is calculated based on the proportional difference between the current price and the TWAP price.
                    If the current price is below the TWAP price, the risk score is 0. The normalized scale is based on the positive difference.</p>
